import React from "react";
import { FaPhoneAlt, FaClock, FaMapMarkerAlt, FaEnvelope } from "react-icons/fa";

const ContactUs = () => {
  return (
    <div className="relative w-full min-h-screen">


      {/* Overlay */}
      <div className="absolute inset-0 bg-black/50"></div>

      {/* Content */}
      <div className="relative z-10 max-w-6xl mx-auto px-6 py-24 text-white text-center">
        {/* Heading */}
        <h1 className="text-4xl md:text-5xl font-bold mb-12">
          Contact Us
        </h1>

        {/* Info Sections */}
        <div className="grid grid-cols-1 md:grid-cols-4 gap-8 text-left">
          {/* Phone */}
          <div className="bg-white/10 backdrop-blur-lg rounded-2xl p-6 flex flex-col items-center">
            <FaPhoneAlt className="text-blue-400 text-3xl mb-4" />
            <h3 className="text-xl font-semibold mb-2">Call Us</h3>
            <p className="text-white/80 text-sm">+91 98765 43210</p>
            <p className="text-white/60 text-xs mt-1">Mon - Sat</p>
          </div>

          {/* Timing */}
          <div className="bg-white/10 backdrop-blur-lg rounded-2xl p-6 flex flex-col items-center">
            <FaClock className="text-yellow-400 text-3xl mb-4" />
            <h3 className="text-xl font-semibold mb-2">Working Hours</h3>
            <p className="text-white/80 text-sm">Monday - Saturday</p>
            <p className="text-white/60 text-xs mt-1">09:00 AM - 06:00 PM</p>
          </div>

          {/* Location */}
          <div className="bg-white/10 backdrop-blur-lg rounded-2xl p-6 flex flex-col items-center">
            <FaMapMarkerAlt className="text-red-400 text-3xl mb-4" />
            <h3 className="text-xl font-semibold mb-2">Location</h3>
            <p className="text-white/80 text-sm">123 Real Estate St.</p>
            <p className="text-white/60 text-xs mt-1">New Delhi, India</p>
          </div>

          {/* Email */}
          <div className="bg-white/10 backdrop-blur-lg rounded-2xl p-6 flex flex-col items-center">
            <FaEnvelope className="text-purple-400 text-3xl mb-4" />
            <h3 className="text-xl font-semibold mb-2">Email Us</h3>
            <p className="text-white/80 text-sm">contact@realestatepro.com</p>
            <p className="text-white/60 text-xs mt-1">We reply within 24 hours</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContactUs;
